/*
    This exercise has been updated to use Solidity version 0.5
    Breaking changes from 0.4 to 0.5 can be found here: 
    https://solidity.readthedocs.io/en/v0.5.0/050-breaking-changes.html
*/
import "./SupplyChain.sol";

pragma solidity ^0.5.0;

contract ProxySupplyChain {

  /* set owner */
  address owner;

  /* SupplyChain contract */
  SupplyChain supplyChain;

  constructor(SupplyChain _supplyChain) public {
    /* Here, set the owner as the person who instantiated the contract
       and set your skuCount to 0. */
    owner = msg.sender;
    supplyChain = _supplyChain;
  }

/* Call Function shipItem from supplyChain contract and return true/false */
  function shipItem(uint sku) public returns (bool) 
  {
    bool r;

    // Try to ship with current account
    (r, ) = address(supplyChain).call(abi.encodeWithSignature("shipItem(uint256)",0));

    return r;
}

/* Call Function receiveItem from supplyChain contract and return true/false */
  function receiveItem(uint sku) public returns (bool) 
  {
    bool r;

    // Try to ship with current account
    (r, ) = address(supplyChain).call(abi.encodeWithSignature("receiveItem(uint256)",0));

    return r;
  }


}
